import React from "react"
import Header from "./components/header.js"
import Albums from "./components/albums.js"
import Data from "data.js"

function App() {
  console.log(Data)
  let TopAlbum = Data.map(album => {
    return(
      <Albums 
      id={album.id}
      items={album}
      />
    )
  })

  return (
    <div className="App">
      <Header />
      {TopAlbum}
    </div>
  );
}

export default App;
